column48:
This was an EOY Review and Planning meeting with the District Contact.  Items discussed/reviewed included:
1.  CWIS Analysis slide presentation---District Analysis by Theme;
2.  SAPP reports---will NOT be taking SAPP in May;
3.  District Implementation Checklist---review of items marked mid or early stage in Feb. 2020---continued focus on using a District Plan Timeline by month to support feedback, monitoring, and implementation of the district focus practices...then guide the DLT with this document.
4.  Summarized next steps for 20-21 based on the discussion of Items 1-3.
5.  Reviewed the new DCI Resources posted on MoEdu-sail and discussed implementation zones understanding for next school year design.
